from itertools import groupby, product
def adrl(s):
    runlens = [len(list(g)) for k, g in groupby(s)]
    return len(runlens) == len(set(runlens))
def a(n):
    if n == 0: return 1
    return 2*sum(adrl("1"+"".join(w)) for w in product("01", repeat=n-1))
